'Action commissions'=>'Aktivitets- provisioner',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Aktivitets- provisionsfunktionen kan du definiera per aktivitet, eller per "någonting" provisioner. <br/> På detta sätt kan du definiera provisioner till exempel per registrerad användare, per nedladdning, per besök på specifik sida, etc. <br/> <a href = "% s " target = "_blank"> Mer hjälp i vår kunskapsbas </ a>',
'More help in our Knowledge Base'=>'Mer hjälp i vår kunskapsbas',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Banner- rotator är en speciell typ av banner som roterar andra banners. <br/> När en affiliate infogar rotator i sin sida, visar rotatorn banners som är tilldelade rotatorn, så att besökaren kommer att se en annan rubrik varje gång han besöker Affiliate- sidan . <br/> <a href="%s" target="_blank"> Mer hjälp i vår kunskapsbas </ a>',
'Branding free'=>'Branding free',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Branding Free är en speciell funktion som tillåter dig att ändra länkarna i sidfoten på paneler och registreringsformulär från "Powered by% s" i din egen text och länk. <br/> <a href = "% s " target = "_blank "> Mer hjälp i vår kunskapsbas </ a>',
'Commission Groups'=>'Provisions- grupper',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Med provisions- grupper kan du ange olika uppdrag för olika användare för samma kampanj. <br/> <a href="%s" target="_blank"> Mer hjälp i vår kunskapsbas </ a>',
'CPM commissions'=>'CPM provisioner',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (cost per mille) provisioner är en speciell typ av provisioner som belönas efter 1000 visningar, vilket innebär för att visa dina banners 1000 gånger. <br/> <a href="%s" target="_blank"> Mer hjälp vår Knowledge Base </ a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Med Forced matris kan du begränsa antalet hänvisningar till subaffiliates som en affiliate kan hänvisa till. Det betyder att varje affiliate bara kan ha ett visst antal subaffiliates. <a href="%s" target="_blank"> Mer detaljer läs i vår kunskapsdatabas </ a>',
'Hosting of %s on  %s servers.'=>'Hosting av %s till servrar  %s.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Flera valutor gör att du kan spåra försäljning i olika valutor. <br/> <a href="%s" target="_blank"> Mer hjälp i vår kunskapsbas </ a>',
'Multiple merchants'=>'Flera managers',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Som standard är alla kampanjer i %s offentliga, vilket innebär att alla affiliates kan visa och främja dem. Med privat- kampanjfunktionen kan du skapa privata kampanjer som kommer att vara synliga endast för utvalda affiliates. <br/> <a href="%s" target="_blank"> Mer hjälp i vår kunskapsbas </ a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Det låter dig skapa en särskild typ av marknadsförande material - nyskapande e-böcker. Du kan bara skapa din PDF e-bok bara en gång och ladda upp den till %s. Dina affiliates kommer automatiskt att få sina egna exemplar av denna "rebrandning" e-boken med sina namn, affiliate länkar, texter, etc. Det finns inget behov att köra ett Windows-program för branding, de kommer helt enkelt att hämta omdöpta PDF. Alla omprofilering sker automatiskt i bakgrunden. <br/> <a href="%s" target="_blank">% s </ a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Med återkommande uppdrag kan du belöna dina affiliates för återkommande betalningar, t.ex. för webbhotell eller medlemskap. <br/> <a href="%s" target="_blank"> Mer hjälp i vår kunskapsbas </ a>',
